me";s:8:"Олег";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:1259:"Здравствуйте, Эльвира Валентиновна, у нас с женой не получается забеременеть 3 года, мы обратились к репродуктологу, пробовали 2 инсеминации, но безрезультатно. Жене сделали лапароскопию, ничего не нашли, после всего обследования ей поставили диагноз бесплодие 1, цервикальный фактор. Я обратился к урологу, после сдачи спермограммы у меня было много патолигий шейки, врач назначил мне Фертило форте, после 3-х месячного приема, количество сперматозоидов увеличилось, но с патологиями стало больше, также я сделал фрагментацию 22,6%. Врач поставил диагнозы астенозооспермия и тератозооспермия и не знает что делать, никаких обследований либо лечения не назначает. Очень надеюсь на Ваш совет.";s:5:"files";s:33:"Прикреплены файлы";s:4:"date";s:24:"20 сентября 2020";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:54:"Исакова Эльвира Валентиновна";s:5:"image";a:18:{s:8:"ORIGINAL";s:28:"/upload/main/976/Isakova.png";s:13:"webp_ORIGINAL";s:51:"/upload/resize_cache/main/976/0_0_1_95/Isakova.webp";s:9:"100_100_P";s:51:"/upload/resize_cache/main/976/100_100_1/Isakova.png";s:14:"webp_100_100_P";s:55:"/upload/resize_cache/main/976/100_100_1_95/Isakova.webp";s:19:"quotas_registration";s:51:"/upload/resize_cache/main/976/190_200_1/Isakova.png";s:24:"webp_quotas_registration";s:55:"/upload/resize_cache/main/976/190_200_1_95/Isakova.webp";s:15:"specialist_list";s:51:"/upload/resize_cache/main/976/352_304_1/Isakova.png";s:20:"webp_specialist_list";s:55:"/upload/resize_cache/main/976/352_304_1_95/Isakova.webp";s:19:"specialist_list_big";s:28:"/upload/main/976/Isakova.png";s:24:"webp_specialist_list_big";s:55:"/upload/resize_cache/main/976/568_548_1_95/Isakova.webp";s:24:"specialist_detail_header";s:28:"/upload/main/976/Isakova.png";s:29:"webp_specialist_detail_header";s:55:"/upload/resize_cache/main/976/448_471_1_95/Isakova.webp";s:26:"specialist_detail_schedule";s:51:"/upload/resize_cache/main/976/320_436_1/