";s:13:"specialist_id";s:0:"";}}i:29141;a:5:{s:15:"DETAIL_PAGE_URL";s:24:"/patients/consult/29141/";s:16:"isAnswererClinic";b:1;s:8:"answerer";a:4:{s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:4:"name";s:8:"МЦРМ";s:8:"position";s:0:"";s:2:"id";s:0:"";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:10:"Алина";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:973:"Здравствуйте, мне 17 лет, у меня две недели назад была такая ситуация, которую ПА назвать нельзя, проникновения внутрь не было, так как мне было больно, но он пытался, потом он вставил палец , мне тоже было больно, после этого он ещё много раз попытался вставить половой член, но не получалось что-то ( первый раз все же) 
